import Button from "../components/Button";
import Card from "../components/DemoCard";
import X from '../assets/x.svg';
import Gmail from '../assets/gmail.svg';
import Phone from '../assets/phone.svg';
import Metamask from '../assets/Metamask.svg';
import WalletConnect from '../assets/WalletConnect.svg';


import "../styles/login.css";

const Login = () => {
  return (
    <div className="login-card">
      <Card />
      <div className="login-box ">
        <div>
         <Button text="Continue with Google" image={Gmail} width={380} backgroundColor='#302c2c' />
         <br />
         <Button text="Continue with X" image={X} width={380} backgroundColor='#302c2c' />
         <br />
         <Button text="Continue with Phone" image={Phone} width={380} backgroundColor='#302c2c' />


        </div>
        <div className="or-divider">
      <div className="line"></div>
      <span className="or-text">OR</span>
      <div className="line"></div>
    </div>
    <div className="d-flex">
       <Button text="Metamask" image={Metamask} width={180} backgroundColor='#201c1c' />
       <Button text="Walletconnect" image={WalletConnect} width={180} backgroundColor='#201c1c' />
       </div>

      </div>
      <div className="footer">Powered by Tria</div>
    </div>
  );
};

export default Login;
